const {
  default: flattenColorPalette,
} = require('tailwindcss/lib/util/flattenColorPalette')

const svgToDataUri = require('mini-svg-data-uri')

/** @type {import('tailwindcss').Config} */
module.exports = {
  content: ['./src/**/*.{js,ts,jsx,tsx}'],
  darkMode: 'selector',
  theme: {
    extend: {
      colors: {
        primary: {
          100: '#f0f9ff',
          200: '#e0f2fe',
          300: '#bae6fd',
          400: '#7dd3fc',
          500: '#38bdf8',
          600: '#0ea5e9',
          700: '#0284c7',
          800: '#0369a1',
          900: '#075985',
        },
      },
      fontFamily: {
        sans: ['var(--font-inter-tight)', 'var(--font-dm-sans)', 'sans-serif'],
        title: ['var(--font-dm-sans)', 'sans-serif'],
      },
      animation: {
        scroll:
          'scroll var(--animation-duration, 40s) var(--animation-direction, forwards) linear infinite',
      },
      keyframes: {
        scroll: {
          to: {
            transform: 'translate(calc(-50% - 0.5rem))',
          },
        },
      },
    },
  },
  plugins: [
    addVariablesForColors,
    function ({ matchUtilities, theme }) {
      matchUtilities(
        {
          'bg-poly': (value) => ({
            backgroundImage: `url("${svgToDataUri(
              `<svg version="1.2" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1919 866" width="1919" height="866"><defs><image   width="1919" height="866" id="img1" href="data:image/png;base64,"/></defs><style></style><use  href="#img1" x="0" y="0"/></svg>`
            )}")`,
          }),
          'bg-poly-dark': (value) => ({
            backgroundImage: `url("${svgToDataUri(
              `<svg version="1.2" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1919 866" width="1919" height="866"><defs><image  width="1919" height="866" id="img1" href="data:image/png;base64,"/></defs><style></style><use style="opacity:.1" href="#img1" x="0" y="0"/></svg>`
            )}")`,
          }),
          'bg-grid': (value) => ({
            backgroundImage: `url("${svgToDataUri(
              `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32" width="32" height="32" fill="none" stroke="${value}"><path d="M0 .5H31.5V32"/></svg>`
            )}")`,
          }),
          'bg-grid-small': (value) => ({
            backgroundImage: `url("${svgToDataUri(
              `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32" width="8" height="8" fill="none" stroke="${value}"><path d="M0 .5H31.5V32"/></svg>`
            )}")`,
          }),
          'bg-dot': (value) => ({
            backgroundImage: `url("${svgToDataUri(
              `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32" width="16" height="16" fill="none"><circle fill="${value}" id="pattern-circle" cx="10" cy="10" r="1.6257413380501518"></circle></svg>`
            )}")`,
          }),
        },
        { values: flattenColorPalette(theme('backgroundColor')), type: 'color' }
      )
    },
  ],
}

function addVariablesForColors({ addBase, theme }) {
  let allColors = flattenColorPalette(theme('colors'))
  let newVars = Object.fromEntries(
    Object.entries(allColors).map(([key, val]) => [`--${key}`, val])
  )

  addBase({
    ':root': newVars,
  })
}
